            "shortDescription": "Your IT Climb ticket gets you discounts on parking, dining, and attractions along the Las Olas Riverfront.",
            "fullDescription": "Start your day on the IT Climb at The Las Olas Riverfront. If you’re driving, the 1 River Plaza parking garage, next to IT Climb Stop 1, offers $5 parking all day when you purchase your IT Climb Ticket at the garage office. On your way back enjoy steaks, burgers and traditional Irish Favorites along with great cold beer and drink specials - at discounted prices - with your IT Climb ticket.  Nearby attractions include the NSU Art Museum Fort Lauderdale and the Riverwalk Esplanade Park.",
