                "title": "Briny Riverfront Pub",
                "type": ["Restaurants & Bars"],
                "description": "Just off Stop 1 and straight across from the Riverwalk is Briny Irish Pub. A place that will make you feel like you just stepped into Ireland.\n\nIt’s St. Patrick’s Day year round at the Briny Irish Pub on the New River in the heart of Ft. Lauderdale at IT Climb Stop 1. Both indoor and outdoor seating are available. Briny’s has a casual, fun and eclectic Irish atmosphere, an impressive array of domestic and imported beers, creative cocktails and live entertainment nightly. Daily Happy Hour 4:00pm – 7:00pm.",
