                "title": "NSU Art Museum of Fort Lauderdale",
                "type": ["Museums"],
                "description": "The mission of NSU Art Museum is to provide exceptional opportunities to access, learn from and be inspired by the highest level of visual artistic expression throughout time and from around the world\n\nLocated at the beginning of Las Olas Boulevard just a 3 minute walk from IT Climb Stop 1, the Museum of Art Fort Lauderdale is a popular cultural attraction in the city. The museum features permanent collections and a steady schedule of temporary exhibits featuring a wide range of artistic styles for all art enthusiasts. Because the exhibits are constantly changed and updated, visitors come back again and again.",
