                "title": "Fort Lauderdale Historical Center",
                "type": ["Museums"],
                "description": "Take a step back in time and stop by the Fort Lauderdale Historical Society, near IT Climb Stop 1. Their mission is to uphold the rich history of Old Fort Lauderdale and let the current community better understand the experiences and occurrences that made the community what it is today. A 1907 House Museum, three 1905 historic structures and a museum with rotational exhibitions along with public lectures, workshops and tours make for a great throwback to Fort Lauderdale's past.",
