                "type": ["Restaurants & Bars"],
                "description": "Enter the luxurious Riverside Hotel at IT Climb Stop 3 to experience fine dining at Indigo Restaurant.\n\nLocated at the Riverside Hotel near IT Climb stop 3, the Indigo Restaurant is known for its fresh seafood, steaks and starters, prepared by executive chef Toby Joseph and his team. A popular brunch spot with a great outdoor seating area, The Indigo Restaurant also boasts of an exceptional wine list at reasonable prices.",
