                "type": ["Restaurants & Bars", "Hotels & Rentals", "Entertainment"],
                "description": "Mouth watering steaks and chops, the freshest pasta and tall martini's define Timpano's Italian Chop House where living is savoring only the best. Robust red wines and perfect martinis served in the Starlight Lounge define this revered establishment. At Timpano's the passion is for food, friends and living the good life. IT Climb can take you there. Simply step off at Stop 3.",
