                "title": "Historic Stranahan House Museum",
                "type": ["Museums"],
                "description": "The original home of Frank and Ivy Stranahan, the founders of Fort Lauderdale and a popular tourist attraction along the New River.\n\nThe Stranahan House is named after its original owners Frank and Ivy Stranahan and is located just a short walk (West) from IT Climb Stop 3. Take a historical tour of the house or join the Sunday night Ghost tour which begins with a house tour and is capped off by a cruise on the New River with narration by “Sea Dog John,\" Stranahan House historian. The cruise is provided by the IT Climb and departs directly from the Stranahan House dock.\n",
