            "shortDescription": "Transfer Stop connecting the New River Route with the Main Fort Lauderdale Route. Access to the popular shops and restaurants on Las Olas Boulevard.",
            "fullDescription": "Stop 4 is one of the busiest stops on the IT Climb routes because of the many Restaurants and shops on Las Olas Boulevard, many of which participate in the IT Climb “Cruise and Save” discount program. Check out the list of Cruise and Save Partners listed below where guests show their IT Climb ticket and get a discount. This popular stop is the IT Climb transfer Hub connecting the New River Route and the Main Fort Lauderdale Route.",
