                "title": "Caffe Europa",
                "type": ["Restaurants & Bars"],
                "description": "This Las Olas Boulevard family-owned Italian restaurant just off Stop 4 has a menu full of classic Italian recipes and champagnes from around the world.\n\nA taste of Italy is waiting for you at IT Climb Stop 3. Caffe Europa Trattoria on Las Olas Boulevard, is a meca for fine Italian dining. Owner Tony Cupelli was born in Calabria, Italy and his dream of bringing fine Italian food to America has become a reality at Caffe Europa. From antipasti, delicious pasta and fabulous salads to the wine bar with an extensive selection, Caffee Europa is world class.",
