                "type": ["Restaurants & Bars"],
                "description": "Browse Gran Forno’s gourmet dessert selection to satisfy your sweet tooth. Just off Stop 4 on Las Olas Boulevard.\n\nThe Gran Forno Bakery is an early morning treat for the senses, with the traditional look and smell of any European bakery to go with a very friendly vibe. Located on Las Olas Street, near IT Climb Stop 3, the award-winning bakery is known for its freshly baked artisan breads and inspired recipes created from the finest quality ingredients.",
