                "title": "15th Street Fisheries",
                "type": ["Restaurants & Bars", "Tours & Attractions", "Shopping", "Hotels & Rentals", "Entertainment", "Marketplace"],
                "description": "Craving Seafood? Enjoy the cuisine at 15th Street Fisheries and make sure to feed the Tarpon off the docks!\n\nAccording to City Data, 15th Street Fisheries is located at Lauderdale Marina, a bustling venue for recreational boaters. Choose from casual outside dining on the spectacular deck, casual inside dining on the first floor or more formal dining on the second floor. The IT Climb docks at the marina dock. A highlight of any trip to 15th Street Fisheries is feeding the giant tarpon found around the docks.",
