                "title": "International Swimming Hall of Fame",
                "type": ["Tours & Attractions", "Shopping", "Hotels & Rentals", "Entertainment"],
                "description": "In a state popularly known for beaches, the International Swimming Hall of Fame is a non profit that promotes the benefits of swimming as a key to fitness and good health. Their Hall of Fame features the history of the lives of some of the most recognized swimmers, divers and water polo players, serving as an inspiration for aspiring and potential swimmers. Located between IntraCoastal Waterway and A1A, is is also close to IT Climb Stop 7.",
