            "shortDescription": "This is the center of activity on Fort Lauderdale Beach and a great destination if you boarded at any IT Climb stops on the mainland side of the Intracoastal.",
            "fullDescription": "When beach traffic is heavy, you can begin your IT Climb tour inland at IT Climb Stops 1, 3, or 4. Parking is more accessible at these locations, and you can enjoy a great boat ride along Millionaire’s Row to Stop 8. That's where all the action is.\nCheck the link below for free live entertainment every Friday Night with “Friday Night Sound Waves”. Check out many IT Climb “Cruise and Save” Partners along the beach and remember, this is the location for many of the major Fort Lauderdale Beach events including the upcoming 3 day Tortuga Music Festival.",
