                "description": "Located at the Sea Club Resort near Stop 8, The Deck Restaurant’s breakfast selection is loved by locals.\n\nThe Deck Restaurant at IT Climb Stop 8 overlooks beautiful Fort Lauderdale Beach and is located at the Sea Club Resort Hotel. Breakfast is king at The Deck and their signature Pecan Waffle is well known. The Deck is also a great spot for casual lunch or dinner after a day on the beach. The Deck bar is rustic but the view of the beach is A List. Happy Hour: 5pm - 7pm.",
