                "type": ["Restaurants & Bars", "Tours & Attractions", "Shopping", "Hotels & Rentals", "Entertainment"],
                "description": "If you’re visiting Fort Lauderdale, trying Shula’s scrumptious selection of cuisine is a must. Located near Stop 8.\n\nDon Shula’s record as head coach of the Miami Dolphins (1970-95) and as head coach of the Baltimore Colts (1963-69) is unmatched in the history of the National Football League. His restaurant is unmatched when it comes to quality of the food, service and atmosphere. A visit is a must in Fort Lauderdale. Shula's on the Beach is a IT Climb Stop 8.",
