            "shortDescription": "The waterfront “Vue on the Water” bar is great for drinks and light cuisine before or after your IT Climb tour.",
            "fullDescription": "Free parking next door at the Galleria Mall, makes this the perfect stop to board the IT Climb. Grab a drink at the GalleryOne DoubleTree before or after your tour. This stop is popular with foreign visitors who enjoy the extensive variety of shops and stores at the Galleria Mall. Also, the famous Bonnet House and Gardens is a short walk over the Sunrise Boulevard Bridge.",
