                "title": "Bistro on the Beach",
                "type": ["Restaurants & Bars"],
                "description": "Open early in the morning with gourmet coffee and breakfast selections until late at night long past sunset, Bistro on the Beach is located just off Stop 9 on North Fort Lauderdale Beach Boulevard at the Sonesta Fort Lauderdale Beach.\n\n999 N. Ft Lauderdale Beach Blvd.\nIf you need to get away from the bustling crowds around Fort Lauderdale, look no further than Bistro on the Beach! This local hidden gem is packed full of stunning views of ocean waves lit by beautiful chandeliers. Perfect for refreshing drinks at sunset (with wine selections ranging from California to Chile), a charming brunch with friends, or a filling breakfast to kick off your plans for the day.",
