                "description": "Enjoy artisan pizzas with friends and family at Franco and Vinny’s near Stop 9.\n\nFort Lauderdale’s famous ‘Pizza Shack’ Franco & Vinnys is a great place to share a true Italian meal with the entire family or a large group of friends, at an affordable price. Located on Sunrise Boulevard, it is close to IT Climb Stop 9. Their fresh ingredients are sourced from carefully chosen and reputed local meat and seafood suppliers and are put together from scratch, to create delicious artisan pizzas and other Italian entrees.",
