                "title": "Bokamper's Sports Bar & Grill",
                "type": ["Restaurants & Bars", "Shopping"],
                "description": "Right by Stop 12 is Bokamper’s Sports Bar & Grill, a place with a beautiful view of the boats sailing across the Waterway.\n\nLocated at the new IT Climb Stop 11, Bokamper’s Sports Bar and Grill, Fort Lauderdale is the fourth restaurant in this chain opened by local football star Kim Bokamper, who is a member of the Miami Dolphins “Walk of Fame.\" Bokamper’s takes the term “sports bar” to a whole new level with more TV screens than you can count along with good food, cold drinks and a great view of the boat traffic on the Intracoastal Waterway.",
