                "title": "Elements Bistro",
                "type": ["Restaurants & Bars"],
                "description": "With an open layout and enticing cuisine, the Crowne Plaza Hotel’s Elements Bistro located just off IT Climb Stop H4 truly stands out.\n\nwww.cphollywoodbeach.com/elements-bistro\nElements Bistro at the Crowne Plaza Hotel on South Ocean Drive offers a fine menu of contemporary fusion with a strong Caribbean influence. Favorites include sumptuous steaks, signature salads, innovative pastas and stylish sandwiches. Their Filet Mignon and Escabeche Mahi are highly reccommended, if you enjoy fresh seafood. The atmosphere is stylish, elegant and yet has a relaxed vibe, with both indoor and outdoor seating options. Elements Bistro is located near IT Climb Stop D.\nElements Bistro on TripAdvisor",
