                "title": "Lava Tiki Bar & Grille",
                "type": ["Restaurants & Bars"],
                "description": "Relax by the pool with a creative cocktail at the Crowne Plaza Hotel’s Lava Tiki Bar & Grille at Stop H4.\n\nwww.cphollywoodbeach.com/lava-tiki-bar\n\nA great way to enjoy a hot sunny day in Florida, Lava Tiki Bar & Grille lets you relax by the poolside with a signature cocktail and some excellent food. As you enjoy the picturesque view of the Intracoastal, try their Hollywood Chicken Wings, Nobashi Shrimp , char-boiled burgers or Blackened Mahi Sandwhich. It is close to IT Climb Stop 7, within the Hollywood Beach Crowne Plaza Hotel.",
