            "shortDescription": "The Beachwalk Resort is the southernmost IT Climb Stop. It overlooks sugary white sand beaches and there is free parking nearby.",
            "fullDescription": "The Beachwalk Resort is a wonderful place to begin or end your IT Climb adventure. If you are staying at the Resort, simply walk out the door and the IT Climb awaits you. If you are driving to this IT Climb Stop, you can park at the Walmart parking lot across the street and there is a walking underpass at the bridge leading directly to the IT Climb dock. There are several dining and cocktail options at the Riverwalk to complete your enjoyable day.\n",
