            "shortDescription": "Hollywood Stop H1 is a new location for IT Climb and lands at Jimmy Buffets 5 O’clock Somewhere Bar at Margaritaville.",
            "fullDescription": "Hollywood IT Climb Stop H1 is located at new Margaritaville Hollywood Beach Resort inspired by the lyrics of Jimmy Buffett. Margaritaville Hollywood Beach Resort is a resort and entertainment complex on the legendary Hollywood Beach Broadwalk.\nHollywood Beach is has remained a South Florida beach town with a relaxed vibe since the1920s., Rent a bike, take a Segway tour or stroll on Hollywood Beach. There are plenty of beachfront pubs and restaurants along the way and in the evening you can dance to the music at the Hollywood Beach Theater an open air venue featuring live music several nights each weak is run by the Margaritaville resort, check on line for details.\n",
