                "title": "5 O'Clock Somewhere Bar",
                "type": ["Restaurants & Bars"],
                "description": "As you exit at the H1 Stop, there’s no way to miss the 5 O’Clock Somewhere Bar situated along the Intracoastal Waterway and home to great food, drink, and music.\n\nIn the heart of Margaritaville and with a packed schedule full of musical guests, this dockside bar is the place to be. Gather around a cozy fire pit as you dine and even take off on paddle boarding and kayak adventures courtesy of Margaritaville Beach Resort, located just next to 5 O’Clock Somewhere Bar.",
