                "description": "Located a few steps to the right as you get off the IT Climb at Stop H1 in Hollywood, Billy’s Stone Crab Restaurant does amazing things with all sorts of fish; especially shellfish. This is another waterfront venue with fantastic views to the west for sunsets. It is also next to the beautifully designed Hollywood Boulevard Bridge which has stylish color changing lighting when the sun goes down.",
