                "title": "Taco Beach Shack",
                "type": ["Restaurants & Bars"],
                "description": "The highly acclaimed Taco Beach Shack is an outdoor Mexican restaurant, famous for its fresh tacos, speciality burritos and quesadillas. Their 5 original hot sauces go well with their special Pepper Crusted Alaskan Crab Taco or Korean Short Rib Taco. Their fresh fish and crab tacos are best enjoyed with their margaritas, sangria or selection of Mexican beers.",
